import React from 'react';
import './DeleteImage.css';
import logo from '../../images/icon.png';
import Navbar from '../Home/Navbar/Navbar';

const DeleteImage = () => {
    return (
        <div>
            <Navbar />
            <div className="container text-center row">
            <div  class="card my-4 text-center col-4" style={{width: '18rem', }}>
                <img src={logo} class="card-img-top mx-auto d-block" alt="..."  
                style={{ width: '50%' }} />
                <div class ="card-body">
                <h5 class ="card-title">Image Tittle</h5>
                <a href="h" class ="btn btn-primary">Delete</a>
                </div>
            </div>
            </div>
        </div>
    );
};

export default DeleteImage;
